/* locObj: 
     locName: identificatore del locator
     locType: tipo di locator (xpath, cssselector, id, class..)
     index: indice del locator, necessario per identificarlo nella tabella della sidebar
*/
self.port.on("execCount", function(locObj) {
  var name = locObj.locName;
  var type = locObj.locType; 
  var i = locObj.nIndex;
  var element;  
  if(type=="id"){
    element = document.getElementById(name);
    if(element!=null){
      payload = {locType : type, locName : name, locN : 1, nIndex : i};
      self.port.emit("instancesCounted", payload);
	}
	else{
	  payload = {locType : type, locName : name, locN : 0, nIndex : i};
	  self.port.emit("instancesCounted", payload);
	}
  }
  else{
    switch(type){    
      case("class"):
	    element = document.getElementsByClassName(name);
	    break;
	  case("name"):
		element = document.getElementsByName(name);
		break;
	  case("cssSelector"):
        element = $(name); 
		break;
	  case("xpath"):
		element = $(document).xpath(name);
		break;
	  default:
		element = document.getElementsByName(name);
	}	
	if(element!=null){
	  elNumber = element.length; 
	  payload = {locType : type, locName : name, locN : elNumber, nIndex : i};
	  self.port.emit("instancesCounted", payload); 
	} 
	else{
	  payload = {locType : type, locName : name, locN : 0, nIndex : i}; 
	  self.port.emit("instancesCounted", payload);
	}
  }
});